import React from 'react';
import './App.css';
import TodoCounter from './components/TodoCounter';
import TodoSearch from './components/TodoSearch';

function App() {
  return (
   <React.Fragment>
    <TodoCounter />
    <TodoSearch />
   </React.Fragment>
  );
}

export default App;
